import React, { Fragment } from "react";
import gLogo from "../../img/hd.png";

const logo = props => (
  <Fragment>
    <div className='Logo'>
      <img src={gLogo} alt='GUARDIAN' />
    </div>
    <h4>
      <Link to='/'>
        <i className='fas fa-code' />
        GUARDIAN Command and Control
      </Link>
    </h4>
  </Fragment>
);
export default logo;
